import pprint
number = ''
number_list = list(number)

######################.......... make List of Lists -------- ################################

start = 0
end = 13
listOfLists = []
while end <= 1000:
    element = number_list[start: end]
    listOfLists.append(element)
    start += 1
    end += 1

######################.......... List of Lists without 0 in it ################################

new_list = ([x for x in listOfLists if not '0' in x])

######################.......... list of lists consisting of integers #########################

integer_list = []
for i in new_list:
    integer = [int(j) for j in i]
    integer_list.append(integer)

######################.......... Products #####################################################

product_list = []
def product(integer_list):

    for x in integer_list:
        prod = 1
        for y in x:
            prod *=y
        product_list.append(prod)

product(integer_list)

######################.......... Dictionary of list + product #################################

product_dict = dict(zip(product_list, integer_list))
print(product_dict)


product_list.sort(reverse=True)
print(product_list)

print(product_dict[23514624000])
